import { Button,Flex,Image,Input,Form} from 'antd';
import Navbar from "../components/Navbar";
export default function ProfilePage({person,setPerson}){
    return(
        <div>
            <Navbar/>
            <Flex justify="space-evenly" className="top-24 bg-gray-100">
                <Flex vertical gap="large" >
                    <Image
                        width={200}
                        src={person.avatar}
                    />
                </Flex>
                <Flex vertical gap="large">
                    <Form label="昵称">
                        <Input value={person.name} onChange={(e)=>setPerson({...person,name:e.target.value})}/>
                    </Form>

                </Flex>
            </Flex>
        </div>
    )
}
